import React, { Component, useState } from 'react';
import Navbar from './components/layout/Navbar';
import Search from './components/quotes/Search';
import Quotes from './components/quotes/Quotes';
import axios from 'axios';
import './App.css';

class App extends Component {
  state = {
    quotes: {},
    count: null
  };
  //const [countries, setCountries] = useState({});

  searchCountries = async text => {
    const res = await axios.get(
      `https://cors-anywhere.herokuapp.com/https://api.tronalddump.io/search/quote?query=${text}`
    );

    //setCountries(res.data._embedded);
    this.setState({ countries: res.data });
    console.log(res.data);
  };

  render() {
    return (
      <div className='App'>
        <Navbar />
        <Search search={this.searchCountries} />
      </div>
    );
  }
}

export default App;
